pragma solidity ^0.8.0;

import "./ILotteryRandom.sol";

contract MoqLotteryRandom is IDynamixLotteryRandom {
	constructor() {

    }

	uint32 public rd = 852369;

    function getRandomNumber(uint256 random) override external view returns(uint32) {
		return rd;
	}

	function setRandomNumber(uint32 newRD) public {
		rd = newRD;
	}
}
